import React, { useState, useEffect } from 'react';
import axios from 'axios';

function Profile() {
  const [history, setHistory] = useState([]);
  const [errorMessage, setErrorMessage] = useState('');

  useEffect(() => {
    const token = localStorage.getItem('token');
    const sessionId = localStorage.getItem('sessionId');

    if (!token && !sessionId) {
      setErrorMessage('You need to log in to view your profile.');
      return;
    }

    axios
      .post(
        'http://localhost:8080/diagnosis-history',
        { token, sessionId },
        { withCredentials: true }
      )
      .then((response) => {
        if (response.data.success) {
          setHistory(response.data.history);
        } else {
          setErrorMessage(response.data.message);
        }
      })
      .catch((error) => {
        setErrorMessage('Failed to load diagnosis history.');
      });
  }, []);

  return (
    <div className="profile">
      <h1>Your Profile</h1>

      {errorMessage && <p className="error-message">{errorMessage}</p>}

      <div className="history">
        {history.length > 0 ? (
          <ul>
            {history.map((item, index) => (
              <li key={index}>
                <h3>{item.diseaseName}</h3>
                <img src={item.imageUrl} alt={item.diseaseName} />
              </li>
            ))}
          </ul>
        ) : (
          <p>No diagnosis history found.</p>
        )}
      </div>
    </div>
  );
}

export default Profile;
